import React from 'react';
import User from './components/User';

export function App (){
    return(
        <React.Fragment>
            <User name="Jeremias" work="Backend Developer" />
            <User name="Jessica" work="Frontend Developer" />
            <User name="Santiago" work="Fullstack Developer" />
        </React.Fragment>
    );
}
